import React from 'react';



const Todoitem=({item})=>{

    return(
        <div className="item">
               TO
            <div className="start_time" key={item.start_time}></div>
            <div className="end_time" key={item.end_time}></div>
            <div className="more" key={item.content}></div>
        </div>  
    );

};

export default Todoitem;
